description:
'OLJO" production – продакшн-студия полного цикла, занимается производством всех видов кино, видео, и аудио продукции, предоставлением широкого спектра продакшн-сервисов.Специализация "OLJO" production: 

- комплексная организация съемок в Кыргызстане; 
- производство рекламных видео и аудио роликов, презентационных фильмов и коммерческого видео; 
- производство музыкальных клипов;
- производство телесериалов и полнометражных художественных фильмов.
